import s from './Friends.module.css'
import Friend from "./Friend/Friend";

let friendData = [
    {name: 'Arman', id: 1},
    {name: 'Nurik', id: 2},
    {name: 'Madya', id: 3},
    {name: 'Damik', id: 4},
    {name: 'Sam', id: 5},
]
let friendElement = friendData.map(f => <Friend name={f.name} id={f.id}/>)

const Friends = () => {
    return (
        <div className={s.items}>
            {friendElement}
        </div>
    );
};

export default Friends;
